// src/pages/UserHome.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Button, Typography, Card, CardContent, Grid } from '@mui/material';

const UserHome = () => {
  const navigate = useNavigate();

  return (
    <div style={styles.container}>
      <Typography variant="h3" style={{ marginBottom: '20px' }}>
        Welcome to Our Booking System
      </Typography>
      <Typography variant="body1" style={{ marginBottom: '20px' }}>
        Discover upcoming events, movies, and theaters near you.
      </Typography>
      <Button
        variant="contained"
        color="primary"
        onClick={() => navigate('/login')}
      >
        Login / Sign Up
      </Button>

      {/* You can add more content below (e.g., teasers for events or movies) */}
      <Typography variant="h5" style={{ marginTop: '40px' }}>
        Upcoming Events
      </Typography>
      <Grid container spacing={2} style={{ marginTop: '16px' }}>
        <Grid item xs={12} sm={6} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h6">Concert: Rocking Stars</Typography>
              <Typography variant="body2" color="textSecondary">
                Date: 2025-06-15
              </Typography>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={12} sm={6} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h6">Art Expo 2025</Typography>
              <Typography variant="body2" color="textSecondary">
                Date: 2025-07-01
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </div>
  );
};

const styles = {
  container: {
    maxWidth: '800px',
    margin: '40px auto',
    textAlign: 'center',
    padding: '20px'
  },
};

export default UserHome;
